import React from "react";
import { awrapper } from "../../dummydata";
import Heading from "../common/heading/Heading";

const Awrapper = () => {
  return (
    <>
      <section className="awrapper">
        <div className="container grid">
          {/* Static Content Section */}
          <div className="static-content">
            <Heading subtitle="About Jai Kisan Agro" />
            <p>
              Jai Kisan Agro is a forward-thinking agricultural company dedicated to transforming waste into health. Through innovative agricultural waste recycling techniques, we are helping to reduce environmental impact while contributing to the sustainable growth of the farming industry.
            </p>
            <Heading subtitle="Our Mission" />
            <p>
              To reduce the harmful environmental impact of agricultural waste and promote a circular economy within the farming sector. By recycling and reusing agricultural waste, we not only minimize pollution but also create valuable resources that enhance soil health, improve crop yields, and reduce dependence on chemical fertilizers.
            </p>
            <Heading subtitle="Our Vision" />
            <p>
              We envision a world where farmers have access to sustainable and eco-friendly solutions that improve crop health, increase productivity, and reduce waste. By leveraging cutting-edge technology and promoting organic, sustainable farming practices, Jai Kisan Agro aims to be at the forefront of agricultural innovation.
            </p>
            <Heading subtitle="Our Values" />
            <p>
              Sustainability: We prioritize environmental protection by transforming waste into resources, reducing pollution, and promoting circular economy practices.
              Innovation: We are constantly exploring new technologies to improve our products and services.
              Empathy: We understand the challenges farmers face, and our solutions are designed to improve their efficiency and profitability.
            </p>
          </div>

          {/* Dynamic Content Section */}
          {awrapper.map((val) => (
            <div className="box flex" key={val.id}>
              <div className="img">
                <img src={val.cover} alt={val.title} />
              </div>
              <div className="text">
                <h1>{val.data}</h1>
                <h3>{val.title}</h3>
              </div>
            </div>
          ))}
        </div>
      </section>
    </>
  );
};

export default Awrapper;
